        SHR_IF_ERR_EXIT(dbal_db_init_table_set_field(unit, db_field, DBAL_FIELD_LAT_PKT_WAS_DROP /* field id*/, TRUE /* Valid*/, 0 /* Size*/, 0 /* Offset*/, DBAL_DB_INVALID /* MaxValue*/, 0 /* MinValue*/, NULL /* ConstValue*/, 1 /* NofInstance*/, DBAL_PERMISSION_READONLY /* Permission*/, FALSE /* ReverseOrder*/, DBAL_FIELD_TYPE_DEF_BOOL /* Type*/));
        result_field_counter++;
        db_field = &cur_table_param->results_set[result_type_counter].result_fields[result_field_counter];
        SHR_IF_ERR_EXIT(dbal_db_init_table_set_field(unit, db_field, DBAL_FIELD_LAT_CURRENT_TS_COUNT /* field id*/, TRUE /* Valid*/, 48 /* Size*/, 0 /* Offset*/, DBAL_DB_INVALID /* MaxValue*/, 0 /* MinValue*/, NULL /* ConstValue*/, 1 /* NofInstance*/, DBAL_PERMISSION_READONLY /* Permission*/, FALSE /* ReverseOrder*/, DBAL_FIELD_TYPE_DEF_ARRAY8 /* Type*/));
        result_field_counter++;
